import './NavBar.css';
import Home from '../Home/home';
import {About} from '../About/About';
// import Contact from '../Contact/Contact';
// import Help from '../Help/Help';
// import React, { useState } from "react";
// import Service from '../ServiceComp/Service';
export function NavBar(prop) {

  const [activePage, setActivePage] = useState("Home");

  const renderComponent = () => {
    switch (activePage) {
      case "Home":
        return <Home />;
      case "About":
        return <About />;
      // case "Contact":
      //   return <Contact />;
      // case "Help":
      //   return <Help />;
      // case "Service":
      //   return <Service />;  
      default:
        return <Home />;
    }
  };


  return (
  <div >
    <nav
      className="d-flex justify-content-between align-items-center p-2 m-1 navbar-custom shadow-lg"
    >
      {/* Brand Title */}
      <div>
        <span className="fw-bolder fs-5">{prop.BrandTitle}</span>
      </div>

      {/* Menu Items */}
      <div>
        {prop.MenuItems &&
          prop.MenuItems.map((item, index) => (
            <span
              key={index}
              className="navbar-item px-3 mx-1 fw-bold"
              onClick={() => alert(`${item} clicked`)} // ✅ clickable
            >
              {item}
            </span>
          ))}
      </div>

      {/* Search Box */}
      <div className="input-group" style={{ width: "200px" }}>
        <input
          type="text"
          className="form-control bg-transparent text-white border-0"
          placeholder="Search"
        />
        <button className="btn btn-warning bi bi-search"></button>
      </div>
    </nav>
  </div>
);

}
